import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import CourseList from './components/course/CourseList'
import NavBar from './components/Navbar'

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path='/courselist' element={<CourseList />}>

        </Route>
      </Routes>
    </Router>
  );
}

export default App;
